import { Fragment, FunctionComponent } from "react";
import PageHeader from "../Components/Atoms/PageHeader";
import ReactPlayer from 'react-player';
import CurrentTime from "../Components/Molecules/currentTime";

const Products: FunctionComponent = () => {
    return (
        <Fragment>
            <PageHeader title='live video opname' />
            <div className="page-container">
                <div className="text-video">
                    <div className="text-above-player">
                        De tijd op dit moment is <CurrentTime></CurrentTime>
                    </div>

                    <div className="supportStockings" >
                        <ReactPlayer width='100%' height='100%' url="https://www.youtube.com/watch?v=jfzmtlx3FMQ" playing controls />
                    </div>

                    <div className="Easyslide_Magnide">

                        <ReactPlayer width='100%' height='100%' url="https://www.youtube.com/watch?v=2sWaVV5Sb2I" playing controls />

                    </div>

                    <div className="map">
                        <img src="" alt="" />
                    </div>
                </div>
            </div>
        </Fragment>
    );
}

export default Products;
